egm.controller("registerController", function ($scope, API) {
    $scope.categories = [];
    $scope.register = {};

    //$scope.chooseCategory = function (_id) {
    //    $scope.categoryId = _id;
    //};
    $scope.selectedCity = 'Egypt';
    $scope.next = function () {
        $scope.frmRegister.txtCity.$validate();
        $scope.frmRegister.txtAddress.$validate();
        $scope.frmRegister.txtDescription.$validate();
    }

    $scope.signOut = function () {
        window.location.href = '/Home';
        localStorage.clear();
    };

    $scope.registerStore = function () {
        $scope.register.Country = $scope.selectedCity;
        //$scope.register.Category = $scope.categoryId;
        $scope.register.CoverPhoto = "data:image/jpeg;base64,";

        if ($('#imgItem').attr('src') != '/img/default-avatar.png') {
            $scope.register.ProfilePicture = $('#imgItem').attr('src');
        } else {
            $scope.register.ProfilePicture = "data:image/png;base64,";
        }

        $scope.loading = true;
        var req = {
            method: 'post',
            url: '/Store/Register',
            data: $scope.register
        }
        API.execute(req).then(function (_res) {
            if (_res.data.code == 100) {
                window.location.href = '/Home';
            } else {
                $scope.loading = false;
                $scope.errMsg = true;
                $scope.errdiv = true;
                $scope.errorMsg = _res.data.data;
            }
        });
    };
});
function convertImgToBase64URL(event) {
    var filesSelected = document.getElementById("uploadItemImage").files;
    if (filesSelected.length > 0) {
        var fileToLoad = filesSelected[0];
        var fileReader = new FileReader();
        fileReader.onload = function (fileLoadedEvent) {
            BaseImg64 = fileLoadedEvent.target.result;
            UploadImage(BaseImg64);
        };
        fileReader.readAsDataURL(fileToLoad);
    }
};

function UploadImage(_BaseImg64) {
    $('#imgItem').attr('src', _BaseImg64);
};